import React, { useState } from "react";

function AudioGenerator() {
    const [prompt, setPrompt] = useState('');
    const [audioFile, setAudioFile] = useState([]);
    const [generatedText, setGeneratedText] = useState([]);

    const handleFileChange = (event) => {
        setAudioFile(event.target.files[0]);
    };

    const extractTextFromAudio = async () => {
        try {
            //extract-audio-text
            const response = await fetch(`http://localhost:8080/audio-generated-text?prompt=${prompt}`)
            const responseText = await response.json();
            console.log(responseText);
            setGeneratedText(responseText);
        } catch (error) {
            console.error("Error generating text : ", error)
        }
    };

    return (
        <div className="tab-content">
            <h2>Add Audio File</h2>

            <input
                type="file"
                // value={prompt}
                onChange={handleFileChange}
            />
            <button onClick={extractTextFromAudio}>Add</button>
        </div>
    );
}

export default AudioGenerator;
